import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";

// Shared landing & terms
import Home from "./pages/home_page_ui";
import Terms from "./pages/terms_page";

// Patient-side
import PatientAuthModal from "./pages/patient/PatientAuthModal";
import PatientDashboard from "./pages/patient/PatientDashboard";
import Records from "./pages/patient/Records";
import Reports from "./pages/patient/Reports";
import AccessLogs from "./pages/patient/AccessLogs";
import AIChat from "./pages/patient/AIChat";
import Emergency from "./pages/patient/Emergency";

// Doctor-side
import DoctorLogin from "./pages/doctor/Login";
import LocationSelection from "./pages/doctor/LocationSelection";
import PatientAccess from "./pages/doctor/PatientAccess";
import DoctorDashboard from "./pages/doctor/Dashboard";
import NewRecord from "./pages/doctor/NewRecord";
import ViewRecord from "./pages/doctor/ViewRecord";
import AccessHistory from "./pages/doctor/AccessHistory";

// Route guard
import ProtectedRoute from "./components/ProtectedRoute";

export default function App() {
  return (
    <Router>
      <Routes>
        {/** PUBLIC ROUTES **/}
        <Route path="/" element={<Home />} />
        <Route path="/terms" element={<Terms />} />

        {/** PATIENT AUTH (Login/Signup in modal) **/}
        <Route path="/login" element={<PatientAuthModal />} />

        {/** PATIENT PROTECTED **/}
        <Route
          path="/dashboard"
          element={
            <ProtectedRoute>
              <PatientDashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/records"
          element={
            <ProtectedRoute>
              <Records />
            </ProtectedRoute>
          }
        />
        <Route
          path="/reports"
          element={
            <ProtectedRoute>
              <Reports />
            </ProtectedRoute>
          }
        />
        <Route
          path="/access-logs"
          element={
            <ProtectedRoute>
              <AccessLogs />
            </ProtectedRoute>
          }
        />
        <Route
          path="/ai-chat"
          element={
            <ProtectedRoute>
              <AIChat />
            </ProtectedRoute>
          }
        />
        <Route
          path="/emergency"
          element={
            <ProtectedRoute>
              <Emergency />
            </ProtectedRoute>
          }
        />

        {/** DOCTOR FLOWS **/}
        <Route path="/doctor/login" element={<DoctorLogin />} />
        <Route
          path="/doctor/location"
          element={
            <ProtectedRoute role="doctor">
              <LocationSelection />
            </ProtectedRoute>
          }
        />
        <Route
          path="/doctor/access"
          element={
            <ProtectedRoute role="doctor">
              <PatientAccess />
            </ProtectedRoute>
          }
        />
        <Route
          path="/doctor/dashboard"
          element={
            <ProtectedRoute role="doctor">
              <DoctorDashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/doctor/records/new"
          element={
            <ProtectedRoute role="doctor">
              <NewRecord />
            </ProtectedRoute>
          }
        />
        <Route
          path="/doctor/records/:recordId"
          element={
            <ProtectedRoute role="doctor">
              <ViewRecord />
            </ProtectedRoute>
          }
        />
        <Route
          path="/doctor/history"
          element={
            <ProtectedRoute role="doctor">
              <AccessHistory />
            </ProtectedRoute>
          }
        />

        {/** CATCH‐ALL REDIRECT **/}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
}
